

Use reviewsDatabase;

CREATE TABLE Uni(
   id INT NOT NULL AUTO_INCREMENT,
   PRIMARY KEY (id),
   Ranks                       INTEGER  NOT NULL  
  ,Institution                 VARCHAR(70) NOT NULL
  ,Entry_Standards             INTEGER  NOT NULL
  ,Student_Satisfaction        NUMERIC(4,2)
  ,Research_Quality            NUMERIC(4,2)
  ,Research_Intensity          NUMERIC(4,2)
  ,Graduate_prospects_outcomes NUMERIC(4,1) NOT NULL
  ,Graduate_prospects_on_track NUMERIC(4,1) NOT NULL
  ,StudentStaff_Ratio          NUMERIC(4,1) NOT NULL
  ,Academic_Services_Spend     INTEGER  NOT NULL
  ,Facilities_Spend            INTEGER  NOT NULL
  ,Degree_Completion           NUMERIC(4,1) NOT NULL
  ,Overall_Score               INTEGER  NOT NULL
);

